import React, { Component } from "react";
import "./thunderanim.css";

class ThunderAnim extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    let lightningarr = ["lightning1","lightning2"]
    return (
      <div className="flash">
        <div className={lightningarr}></div>
      </div>
    );
  }
}

export default ThunderAnim;
